import React from 'react';
import Header from '../layouts/Header';

export default function Result({ location }) {
    console.log(location.state.list);

    return (
        <div>결과</div>
    )

    return (
        <ConsultStyled>
            <Header count={count} total={list.length} />
            <div className="question-container">
                {questionList}
            </div>
            <div className="logo">
                <img src={logo}/>
            </div>
        </ConsultStyled>
    )
}
